import React from "react";
import './skills.css';
import Logos from "../../../../logos/logo";

function Skills(){
    return(
        <div id="skills" className="contenedor-skills">
            <div>
                <div className="skills">
                    <Logos 
                        name='JavaScript'
                        img= {'git.png'}
                    />
                </div>
            </div>
        </div>
    );
};

export default Skills;
